import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';

import { StytchProvider } from '@stytch/react';

const stytchPublicToken = 'public-token-test-221b1d53-3641-4eef-b06a-f3daf1269717'; // Use your public token here

const root = ReactDOM.createRoot(document.getElementById('root'));

root.render(
  <StytchProvider
    stytch={stytchPublicToken}
    config={{ env: 'test' }} // use 'live' in production
  >
    <App />
  </StytchProvider>
);
